import logo from "./logo.svg";
import "./App.css";
import { Form } from 'semantic-ui-react';

function App() {
  return (
    <div>
      <div className="navbar">GitHub User Search</div>
      <div className="search">
        <Form>
          <Form.Group>
            <Form.Input placeholder="GitHub user" name="github user" />
            <Form.Button content="Search" />
          </Form.Group>
        </Form>
      </div>
    </div>
  );
}

export default App;
